import React from 'react';

const Navbar = () => {
  return (
    <div className="navbar">
      <div className="pull-center">
        <a className="navbar-brand">
          <img src="./favicon.ico" height="25" width="25" />
          <span className="hidden-folded inline">HR</span>
        </a>
      </div>
    </div>
  );
};

export default Navbar;
